

DROP DATABASE IF EXISTS `dynamo_consult_db`;
CREATE DATABASE `dynamo_consult_db`;
USE `dynamo_consult_db`;



CREATE TABLE `regions` (
  `regionid` int(11) PRIMARY KEY,
  `regionname` varchar(50) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;






CREATE TABLE `centers` (
  `centerid` int(11) PRIMARY KEY,
  `centername` varchar(50) NOT NULL,
  `regionid` int(11) NOT NULL,
   CONSTRAINT `centers_ibfk_1` FOREIGN KEY (`regionid`) REFERENCES `regions` (`regionid`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;





CREATE TABLE `courses` (
  `courseid` int(11) PRIMARY KEY,
  `coursename` varchar(100) NOT NULL,
  `coursecode` char(2) NOT NULL,
  `courseamount` double(8,2) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;





CREATE TABLE `session` (
  `sessionid` int(11) PRIMARY KEY,
  `sessiontype` varchar(20) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




CREATE TABLE `students` (
  `STUDENTID` int(11) NOT NULL,
  `centerid` int(11) NOT NULL,
  `first_name` varchar(50) NOT NULL,
  `last_name` varchar(50) NOT NULL,
  `gender` varchar(6) NOT NULL,
  `courseid` int(11) NOT NULL,
  `sessionid` int(11) NOT NULL,
  `amountpaid` double(8,2) NOT NULL,
  `startdate` date NOT NULL,
  `enddate` date NOT NULL,
  `phoneno` varchar(20) NOT NULL,
  `email` varchar(50) NOT NULL,
  CONSTRAINT `students_ibfk_1` FOREIGN KEY (`centerid`) REFERENCES `centers` (`centerid`) ON UPDATE CASCADE,
  CONSTRAINT `students_ibfk_2` FOREIGN KEY (`sessionid`) REFERENCES `session` (`sessionid`) ON UPDATE CASCADE,
  CONSTRAINT `students_ibfk_3` FOREIGN KEY (`courseid`) REFERENCES `courses` (`courseid`)ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;






















